import Head from 'next/head';

import { Jumbotron, Container, Form, FormGroup, Label, Input, Button } from 'reactstrap';
import Menu from '../components/Menu';


function Home() {
  return (
    <>
      <Head>
        <title>Contato - Luciano </title>
        <meta name="description" content="Contato com a empresa..." />
        <meta name="author" content="Luciano Valente" />
      </Head>
      
      <Menu />

      <Jumbotron fluid className="descr-top">
        <style>
          {`.descr-top{
            background-color: #000;
            color: #fed136;
            padding-top: 100px;
            padding-bottom: 50;
            margin-bottom: 0rem !important;
          }`}
        </style>
        <Container className="text-center">
          <h1 className="display-4">Contato</h1>
        </Container>
      </Jumbotron>
      <Jumbotron fluid className="form-contato">
        <style>
          {`.form-contato{
            padding-top: 80px;
            padding-bottom: 80px;
            background-color: #FFF;
            margin-bottom: 0rem !important;
          }`}
        </style>
        <Container>
          <Form>
            <FormGroup>
              <Label for="name">Nome</Label>
              <Input type="text" name="name" id="name" placeholder=" Digite seu Nome Completo"/>
            </FormGroup>
            <FormGroup>
              <Label for="email">Email</Label>
              <Input type="text" name="email" id="email" placeholder="Digite seu email"/>
            </FormGroup>
            <FormGroup>
              <Label for="subject">Assunto</Label>
              <Input type="text" name="subject" id="subject" placeholder="Digite o assunto do contato"/>
            </FormGroup>
            <FormGroup>
              <Label for="content">Conteúdo</Label>
              <Input type="textarea" name="content" id="content" placeholder="Digite o conteúdo da mensagem"/>
            </FormGroup>

            <Button type="submit" outline color="warning">Enviar</Button>
          </Form>
        </Container>
      </Jumbotron>
    </>
  );
}

export default Home;
